import React from 'react';


class App extends React.Component{

    constructor(props){
        super(props)

        this.state = {
            users: []
        }
    }
    
    componentDidMount(){
        fetch('https://dummyjson.com/users')
        .then(res => res.json)
        .then(
            (result) => {
                this.setState({
                    users: result.users
                });
            }
        )
    }

    render(){
        const users = this.state.users;
        const user_list = users.map(user => (<li>{user.firstName}</li>))

        return(
            <div>
                <ul>
                    <li>{user_list}</li>
                </ul>
            </div>
        )
    }
}

export default App
